INSERT INTO `locations` (`id`, `uuid`, `organisation_id`, `name`, `description`, `slug`, `latitude`, `longitude`, `street`, `number`, `bus`, `postal_code`, `city`, `country`, `country_code`, `is_visible`, `is_suggestion`, `suggestion_for_location_id`, `created_at`, `updated_at`, `deleted_at`)
VALUES
	(1,'efe298d6-dd47-4272-96a2-dd974141a854',1,'{\"nl\": \"Huis Jerome Collin\"}','{\"nl\": \"Eigen herstel- en leveringsdienst\\nWij leveren graag uw gekocht toestel bij u thuis.\\nVraag naar de voorwaarden in de winkel.\\n\\nOns eigen herstelatelier en onze techniekers herstellen graag uw defect toestel: vraag meer info in de winkel.\"}','{\"nl\": \"huis-jerome-collin\"}',50.87052070,4.65348090,'Tervuursesteenweg ','220',NULL,'3001','Heverlee','Belgium ','BE',1,0,NULL,'2021-04-09 15:52:49','2021-05-05 13:59:47',NULL),
	(2,'4dd08150-b4cc-494c-bac1-04a4ee9f9b8c',2,'{\"nl\": \"Aitec\"}','{\"nl\": \"AITEC is een technische vakhandel voor electronica in Leuven en Oost-Vlaams-Brabant. Onze firma start waar de Hifi, TV of computerzaak eindigt. Bij ons worden die zaken aangeboden die niet of moeilijk in de klassieke handel verkrijgbaar zijn. U kan bij ons terecht voor alle soorten batterijen, audio, video of computerkabels, enz.. Ons gamma en onze stock zijn zeer uitgebreid. Hebt u een elektronica probleem en weet u niet waar u daarvoor terecht kan, probeer ons eens. Veel kans dat we u kunnen helpen.\"}','{\"nl\": \"aitec\"}',50.85612190,4.69542920,'Naamsesteenweg ','380',NULL,'3012','Heverlee','Belgium ','BE',1,0,NULL,'2021-04-09 15:52:49','2021-05-05 13:59:48',NULL),
	(3,'6c6412e4-0222-4641-a8a3-113291be830f',3,'{\"nl\": \"Metaleuven\"}','{\"nl\": null}','{\"nl\": \"metaleuven\"}',50.89041220,4.70755670,'Aarschotsesteenweg ','22',NULL,'3000','Wilsele','Belgium ','BE',1,0,NULL,'2021-04-09 15:52:49','2021-05-05 13:59:48',NULL),
	(4,'15dd1214-c9ba-4321-a4c2-4f5b8f9a1464',4,'{\"nl\": \"JVG BV\"}','{\"nl\": null}','{\"nl\": \"jvg-bv\"}',50.86619410,4.74554445,'Tiensesteenweg ','404',NULL,'3000','Leuven','Belgium ','BE',1,0,NULL,'2021-04-09 15:52:49','2021-05-05 13:59:49',NULL),
	(5,'1effb822-0c07-465d-9e2b-518346e4a8c7',5,'{\"nl\": \"Selexion De Sander\"}','{\"nl\": null}','{\"nl\": \"selexion-de-sander\"}',50.90993990,4.71326700,'Aarschotsesteenweg ','552',NULL,'3000','Wilsele','Belgium ','BE',1,0,NULL,'2021-04-09 15:52:49','2021-05-05 13:59:49',NULL),
	(6,'7bb84c27-c70b-4bfe-8fce-be1da1e79e55',6,'{\"nl\": \"Bekaert computers\"}','{\"nl\": null}','{\"nl\": \"bekaert-computers\"}',50.87425265,4.69177525,'Kapucijnenvoer ','203',NULL,'3000','Leuven','Belgium ','BE',1,0,NULL,'2021-04-09 15:52:49','2021-05-05 13:59:50',NULL),
	(7,'5a939b69-f8bd-43d9-8642-345826be96ed',7,'{\"nl\": \"Ericom\"}','{\"nl\": null}','{\"nl\": \"ericom\"}',50.87481830,4.71034546,'Tiensestraat ','178',NULL,'3000','Leuven','Belgium ','BE',1,0,NULL,'2021-04-09 15:52:49','2021-05-05 13:59:50',NULL),
	(8,'fc30b890-0b63-4417-9806-35aa1fd07392',8,'{\"nl\": \"atelier VAN EYCK\"}','{\"nl\": \"Welkom! Al meer dan 110 jaar vindt u bij familiebedrijf Atelier Van Eyck degelijke kwaliteit en service.\\nOnze roots liggen in de ijzerwaren. We zijn een zaak die blijft evolueren, volledig mee met de tijd en gericht naar de toekomst.\\nEsthetiek en kwaliteit blijven we verbinden. \\n... Het doet vermoeden dat kunstschilder Jan Van Eyck in ons DNA terug te vinden is ...\"}','{\"nl\": \"atelier-van-eyck\"}',50.87839345,4.70358984,'Tiensestraat ','15',NULL,'3000','Leuven','Belgium ','BE',1,0,NULL,'2021-04-09 15:52:49','2021-05-05 13:59:51',NULL),
	(9,'b05e184b-fe33-4728-891c-e452760f4ea9',9,'{\"nl\": \"Repair Café Wijgmaal\"}','{\"nl\": \"Maakbaar Leuven is een netwerkorganisatie die een lans wil breken voor de hersteleconomie. De vzw bundelt kennis, kunde en infrastructuur voor hersteloplossingen in de Leuvense regio.\\nMet de hulp van geëngageerde burgers (van 15 tot 105) verkleinen we de afvalberg. Zo hebben we, samen met onze partners, een repair-beweging opgebouwd met heel wat expertise.\"}','{\"nl\": \"repair-cafe-wijgmaal\"}',50.92573010,4.70543030,'Pastoor Bellonstraat ','29',NULL,'3018','Wijgmaal','Belgium ','BE',1,0,NULL,'2021-04-09 15:52:49','2021-05-05 13:59:51',NULL),
