	(484,'3897baad-d93d-4901-868a-26e0e8a17b50',484,'{\"nl\": \"A&B Reparatie Service\"}','{\"nl\": \"A&B Reparatie service Apeldoorn repareert witgoed apparaten. Bent u op zoek naar een Witgoed reparatie service voor uw wasmachine, droger, vaatwasser, magnetron inductie, gas of keramische kookplaat? Onze monteur komt bij u langs en u kunt tijdens de reparatie over zijn schouder meekijken, zodat alles transparant voor u is. Is er toch meer stuk, dan wordt er met u als klant overlegt of u dit dan wilt laten repareren of niet.\"}','{\"nl\": \"ab-reparatie-service\"}',52.19843920,6.01556410,'Zadelmakersdonk','601',NULL,'7326 JW ','Apeldoorn','Netherlands','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:03:51',NULL),
	(485,'bd47e186-dcf9-4ff6-931d-0da95e9b6018',485,'{\"nl\": \"Alfabyte\"}','{\"nl\": \"Op zoek naar een betaalbare en preventieve oplossing voor uw computer- of laptop problemen of wensen, zoals een upgrade van uw huidige computer? Dan bent u bij ons aan het juiste adres. Wij hebben een eigen technische dienst maar komen ook bij u op locatie!\"}','{\"nl\": \"alfabyte\"}',52.20529560,5.94911340,'Koningslijn','10',NULL,'7312 GG','Apeldoorn','Netherlands','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:03:51',NULL),
	(486,'969be928-9657-4c50-b6a0-04482fddb37e',486,'{\"nl\": \"All-in Witgoedservice \"}','{\"nl\": \"All in Witgoedservice is dé witgoedspecialist van regio Apeldoorn. Naast het inbouwen van onder andere vaatwassers, magnetrons en ovens leveren wij ook onderdelen en repareren aan huis. Eerlijkheid en betrouwbaarheid staan bij ons voorop en wij werken snel voor een goede prijs. Al onze prijzen zijn zoals onze naam al doet vermoeden All Inclusive! Voor spoedgevallen is All in Witgoedservice 24 uur per dag, 7 dagen per week telefonisch te bereiken.\"}','{\"nl\": \"all-in-witgoedservice\"}',52.20982430,5.96424480,'Nieuwendijk ','204',NULL,'7311 RN','Apeldoorn','Netherlands','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:03:52',NULL),
	(487,'16995cfb-0fea-4f2f-81a5-e00d4c8bd4e4',487,'{\"nl\": \"Computer Support Apeldoorn\"}','{\"nl\": \"Is uw computer vastgelopen, heeft u virusproblemen, werkt uw (draadloos)netwerk niet? Of wilt u advies bij aanschaf van computer- en multimedia-apparatuur.\\nWij komen langs, wanneer het U uitkomt!\"}','{\"nl\": \"computer-support-apeldoorn\"}',52.21134160,5.95117430,'Asselsestraat ','141',NULL,'7311 EK','Apeldoorn','Netherlands','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:03:52',NULL),
	(488,'8ef683df-b056-4c81-bd98-9c9e64fb4731',488,'{\"nl\": \"Edutech Bouwmachine Service\"}','{\"nl\": \"Edutech Bouwmachine Service bestaat intussen al meer dan 15 jaar. In al die jaren uitgegroeid tot een allround serviceverlenend bedrijf dat onderhoud en reparaties uitvoert aan diverse bouwmachines zoals shovels, graafmachines en trilplaten.\"}','{\"nl\": \"edutech-bouwmachine-service\"}',52.20165780,5.94575030,'Veenweg ','38D',NULL,'7336 AG ','Apeldoorn','Netherlands ','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:03:53',NULL),
	(489,'98a1c9ba-81de-4a7f-a7b0-d87731039105',489,'{\"nl\": \"JDA witgoed \"}','{\"nl\": \"JDA Witgoed: dé witgoedspecialist van Apeldoorn en omstreken!\\nHet gezicht van JDA Witgoed is John Dalhuisen, een zeer ervaren witgoed en elektrotechnisch monteur.\\nIn zijn jarenlange carrière is hij alles wel een keer tegen gekomen. Deze ervaring zet hij in om uw apparaat snel en doeltreffend te repareren. Mocht uw apparaat de reparatie niet waard zijn zal hij daar duidelijk over communiceren en diverse andere opties bieden.\"}','{\"nl\": \"jda-witgoed\"}',52.20073030,5.94400470,'Veenweg ','62',NULL,'7336 AG ','Apeldoorn','Netherlands','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:03:53',NULL),
	(490,'78cfdbfa-b8f3-488c-a80c-eff9e2652b6b',490,'{\"nl\": \"Hitronics \"}','{\"nl\": \"Hitronics heeft haar pijlen voornamelijk gericht op het leveren van goederen en diensten aan particulieren en bedrijven.\\n\\nWij leveren de volgende ICT diensten:\\n\\nVerkoop van (nieuwbouw) desktop computers\\nComputer reparatie\\nBeheer van uw infrastructuur\\nDraadloze netwerk oplossingen\\nSynology Backup oplossingen\\nWebServices\\nServer Management\\nsuper snelle service!\\nen nog veel meer!\"}','{\"nl\": \"hitronics\"}',NULL,NULL,'De terassen','31',NULL,'7325 JA','Apeldoorn','Netherlands','NL',1,0,NULL,'2021-04-09 15:52:57','2021-04-09 15:52:57',NULL),
	(491,'ae87a3b4-5669-404c-9a84-24780353df3c',491,'{\"nl\": \"ICanFix\"}','{\"nl\": \"iCanFix repareert werkelijk alles op electronica gebied, maar ook voor bijvoorbeeld garantie afhandeling kunt u bij ons terecht.\\n\\nWij behandelen oprecht alle mogelijke reparaties, daardoor heeft u maar 1 partner nodig, iCanFix\"}','{\"nl\": \"icanfix\"}',52.24685020,5.97171190,'Stadhoudersmolenweg ','144',NULL,'7317 AW ','Apeldoorn','Netherlands','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:03:54',NULL),
