	(497,'7c7db672-3ed1-4f0a-869d-a653652d9c2e',497,'{\"nl\": \"MobileNed\"}','{\"nl\": \"MobileNed reparateurs hebben de juiste kennis in huis voor reparaties aan iPhone en iPad. Doordat wij enkel Apple producten repareren hebben wij hier veel ervaring mee en bieden wij een professioneel uitgevoerde reparatie. \\n\\nDaarnaast maken wij alleen gebruik van kwaliteitsonderdelen. \\n\\nHierdoor geven wij ook 1 jaar garantie op de reparatie (m.u.v. batterijen). \"}','{\"nl\": \"mobilened\"}',52.19105070,6.00176800,'Landmetersveld','206',NULL,'7327 KN','Apeldoorn','Netherlands','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:03:57',NULL),
	(498,'50f0f6ee-b739-47db-87cf-9ec5724ee5c0',498,'{\"nl\": \"ACTG \"}','{\"nl\": \"Niets vervelender dan een storing of defect. Reparatie is dan gewenst en het liefst op korte termijn. Een lang traject met vele stadia kan dan ook nog eens frustrerend werken. Wat u zoekt is een duidelijk en helder antwoord. Bij ACTG bekijken en bepraten we de reparatie/storing met u persoonlijk. Op deze wijze zijn er ook goede afspraken te maken over kosten en reparatietermijnen. Afhankelijk van de aard van de reparatie of storing is het mogelijk om naar een tijdelijk/vervangend apparaat te kijken. Op deze wijze kun u gewoon verder totdat de hoofdstoring is verholpen of reparatie uitgevoerd.\\n\\n \\n\\nWij repareren praktisch alles op het gebied van elektronica. Vooraf doen wij een onderzoek naar het defect en krijgt u van ons een prijsopgave. Bij de ontvangst van de prijsopgave kunt u altijd nog beslissen of u de reparatie doorgang wil laten vinden of niet. Natuurlijk adviseren wij u ook of het raadzaam is om de reparatie te laten uitvoeren. Soms kan het apparaat of onderdeel laten vervangen voordeliger zijn dan repareren. Ook op dit gebied krijgt u weloverwogen advies. Aan het onderzoek zijn geen kosten verbonden.\"}','{\"nl\": \"actg\"}',52.19482780,5.98542020,'Rietdekkersdreef','91',NULL,'7331 DN','Apeldoorn','Netherlands ','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:03:58',NULL),
	(499,'015afae4-7881-4ea0-837e-2f901bfdf3d6',499,'{\"nl\": \"PC Coach \"}','{\"nl\": \"Diagnose en reparatie\"}','{\"nl\": \"pc-coach\"}',52.19896170,6.00187610,'Warenargaarde ','2a',NULL,'7329 BJ','Apeldoorn','Netherlands','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:03:58',NULL),
	(500,'a5d87f92-04eb-4b99-aaff-3e9fbb6ce450',500,'{\"nl\": \"Ray\'s guitar Repair house\"}','{\"nl\": \"Bij Ray\'s Guitar kun je jouw gitaar of bass, professioneel laten afstellen, repareren, onderhouden, refretten, vlakken en cröwnen of te laten modificeren.\"}','{\"nl\": \"rays-guitar-repair-house\"}',52.20624660,5.97037610,'Vinkenlaan ','13',NULL,'7331 VA','Apeldoorn ','Netherlands','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:03:59',NULL),
	(501,'a99aac35-5028-4379-8783-b44eb86e7e59',501,'{\"nl\": \"Technorette\"}','{\"nl\": \"Technorette repareert alle merken elektrische huishoudelijke apparaten voor particulieren, maar ook voor bedrijven en instellingen. Wij repareren op locatie en wanneer nodig in onze moderne werkplaats. Door onze uitgebreide onderdelenvoorraad zijn wij in bijna alle gevallen in staat uw apparaat direct te repareren. \"}','{\"nl\": \"technorette\"}',52.19388410,5.94243350,'Schumanpark ','41',NULL,'7336 AM','Apeldoorn','Netherlands','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:03:59',NULL),
