	(503,'46d46cca-ad35-4b5d-b77f-7e1441e0187b',503,'{\"nl\": \"Foenix Repaircafe \"}','{\"nl\": \"Kapot is het nieuwe nieuw! Bij het permanente Repair Café kun je terecht voor reparatie aan kleingoed met een stekker. Samen met jou wordt gekeken of het defect is op te lossen.\"}','{\"nl\": \"foenix-repaircafe\"}',52.22588740,5.97274910,'Vlijtseweg ','136',NULL,'7317 AK','Apeldoorn','Netherlands','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:04:00',NULL),
