	(505,'910bc385-41f0-4caf-8088-fff164b9d15d',505,'{\"nl\": \"Kringloopwinkel de Hofstad\"}','{\"nl\": \"ONZE MISSIE\\n1) HET WEGGOOIEN VAN GOEDE  GOEDEREN VOORKOMEN\\n2) MENSEN MET EEN KLEINE BEURS HELPEN GOEDKOOP TE KUNNEN KOPEN\\n3) GOEDE DOELEN FINANCIEEL STEUNEN\"}','{\"nl\": \"kringloopwinkel-de-hofstad\"}',52.20757680,5.97466620,'Kayersdijk ','9',NULL,'7332 AH','Apeldoorn ','Netherlands','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:04:01',NULL),
	(506,'b13c6ebe-639b-4091-b044-f631e5fa565c',506,'{\"nl\": \"Foenix Kringloop\"}','{\"nl\": \"Waarom hergebruiken met Foenix? Het is goed voor het milieu en het klimaat. Je ondersteunt mensen bij hun re-integratie. Jouw herbruikbare spullen zijn pareltjes voor een ander.\"}','{\"nl\": \"foenix-kringloop\"}',52.18251740,5.98542550,'Aruba ','6-12',NULL,'7332 BK','Apeldoorn','Netherlands ','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:04:02',NULL),
	(507,'181fca21-6abb-49af-bf20-940fcfac893f',507,'{\"nl\": \"Foenix Kringloop\"}','{\"nl\": \"Waarom hergebruiken met Foenix? Het is goed voor het milieu en het klimaat. Je ondersteunt mensen bij hun re-integratie. Jouw herbruikbare spullen zijn pareltjes voor een ander.\"}','{\"nl\": \"foenix-kringloop-1\"}',52.20664280,5.98187540,'Molenmakershoek ','7',NULL,'7328 JK','Apeldoorn','Netherlands ','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:04:02',NULL),
	(508,'f79b1c61-fc49-4dcc-948e-ad08add12305',508,'{\"nl\": \"Daan\'s Hulp\"}','{\"nl\": \"Mijn computerwinkel is gevestigd in Apeldoorn. Hier voer ik reparaties uit, help ik klanten en verkoop ik computer en telefoon onderdelen. Komt u gerust eens langs voor een kopje koffie of thee.\"}','{\"nl\": \"daans-hulp\"}',52.11622520,5.87530390,'Veldheim','26',NULL,'7351 CE','Hoenderloo','Netherlands','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:04:03',NULL),
	(509,'a1023a81-1c29-4141-883a-2a559e842ef1',509,'{\"nl\": \"Stad Phone \"}','{\"nl\": \"StadPhone staat bekend als de Gsm-specialist van Apeldoorn. We bieden onze service en producten al meer dan 14 jaar in Apeldoorn. Door onze ervaring kunnen we u op alle gebieden van telefonie, tablets en computers helpen. Al u problemen ondervindt met of vragen heeft kunt u altijd bij ons langs komen en wij zoeken graag samen met u de oplossing. Voor reparatie bent u bij ons aan het juiste adres. Iedere werkdag kunt u zonder afspraak uw toestel bij ons langs komen brengen. Uw toestel zal ter plekke in onze “repair centre” gerepareerd worden. Voor smartphone en tablet accessoires hebben wij de grootste keus in Apeldoorn sinds 2001\"}','{\"nl\": \"stad-phone\"}',52.21633380,5.95862340,'Hoofdstraat','161c',NULL,'7311 AW ','Apeldoorn','Netherlands','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:04:03',NULL),
	(510,'94bd9612-71f1-4dbc-8f84-6cae3980d3b0',510,'{\"nl\": \"Repair plus\"}','{\"nl\": \"Welkom allemaal. Repair Plus is een telefoonwinkel gevestigd in Apeldoorn, Stationsstraat 145B. Voor de beste service en kwaliteit kunt u bij ons terecht.\\n\\nGelukkig kunnen wij je reparatie vaak erg snel uitvoeren. Een van onze reparatie specialisten behandelt de reparatie direct en zal je toestel vakkundig repareren. Je  reparatie wordt altijd vakkundig uitgevoerd en op elke reparatie zit standaard 6 maanden garantie zodat je bent verzekerd van een goed werkende toastel.\"}','{\"nl\": \"repair-plus\"}',52.21420450,5.96621280,'Stationsstraat ','145B',NULL,'7311 MD','Apeldoorn','Netherlands','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:04:04',NULL),
	(511,'3c404993-0a28-4b17-b196-c377422917d5',511,'{\"nl\": \"RTV Stegeman\"}','{\"nl\": \"Een defect of storing aan een apparaat is heel erg vervelend. Dat snappen we. In onze winkel stellen we de hoogste eisen en leveren uitsluitend hoge kwaliteit. Toch kan het voorkomen dat apparatuur niet naar behoren werkt. Geen zorgen, we gaan direct voor u aan de slag met de reparatie.\"}','{\"nl\": \"rtv-stegeman\"}',52.21539210,5.94008710,'schuttersweg','88',NULL,'7314 LJ ','Apeldoorn','Netherlands','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:04:04',NULL),
	(512,'a60b6ed5-811c-498b-9983-19b70c285214',512,'{\"nl\": \"Het onderdelenhuis Plentyparts\"}','{\"nl\": \"Al 30 jaar het meest complete onderdelenhuis van Apeldoorn en omstreken! In 1987 zijn wij als “Het Onderdelenhuis” gevestigd aan de Asselsestraat in Apeldoorn (sinds 1996 Plentyparts). Veel klanten in en rondom Apeldoorn hebben ons weten te vinden als hét adres voor onderdelen en accessoires voor: huishoudelijke apparaten, elektra, sanitair, fiets, auto, computer, printer, smartphones en tablets. Daarnaast hebben wij een groot assortiment onderhouds- en reinigingsproducten voor alles in en om je huis.Onze specialisten hebben jarenlange ervaring en zijn bijna opgegroeid in onze winkel. Wij vinden het belangrijk om onze klanten nét die extra service te geven die je in andere winkels of online niet tegenkomt. We denken graag in oplossingen. Plentyparts Apeldoorn is gewoon hét onderdelenhuis\"}','{\"nl\": \"het-onderdelenhuis-plentyparts\"}',52.21114850,5.95062010,'Asselsestraat ','151',NULL,'7311 EK','Apeldoorn ','Netherlands ','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:04:05',NULL),
	(513,'2e04f994-bb72-4ecc-a6ef-c4aaa85dbe41',513,'{\"nl\": \"Repair Café Talma Borgh Apeldoorn\"}','{\"nl\": \"reparatiekennis van beeld en geluidsapparatuur, computerapparatuur/ telefoons, fietsen, gereedschap elektrisch, huishoudelijke apparaten, niet huishoudelijke apparaten, meubels, elektrisch speelgoed, \"}','{\"nl\": \"repair-cafe-talma-borgh-apeldoorn\"}',52.21406190,6.00769380,'Fortlaan ','47',NULL,'7325 ZE','Apeldoorn ','Netherlands','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:04:05',NULL),
	(514,'32636c93-1995-4166-a259-92438a39ff8f',514,'{\"nl\": \"PartsNL\"}','{\"nl\": \"Heb je een vraag over je apparaat of wil je advies over het onderhoud of het vervangen van een onderdeel? Kijk in ons adviescentrum\"}','{\"nl\": \"partsnl\"}',52.24298530,5.98539340,'Weegschaalstraat','15',NULL,'7324 BE ','Apeldoorn','Netherlands','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:04:06',NULL),
	(515,'5353fc99-0e3a-4967-b238-8980749cc484',515,'{\"nl\": \"Hamer Electro World \"}','{\"nl\": \"Ook voor reparaties van uw apparatuur bent u bij ons op het goede adres, deze worden vakkundig uitgevoerd door onze eigen technische dienst. Wij streven er dan ook naar om u zo goed mogelijk van dienst te kunnen zijn.\"}','{\"nl\": \"hamer-electro-world\"}',52.19997100,5.96080850,'Talingweg','76a-78a',NULL,'7331 GP','Apeldoorn','Netherlands','NL',1,0,NULL,'2021-04-09 15:52:57','2021-05-05 14:04:06',NULL),
	(516,'8ff61cb4-443a-4efb-9549-136440494dw',516,'{\"nl\": \"De Bosselaar\"}','{\"nl\": \"<div>Defect aan uw telefoon of tablet? Ook dan komt u naar Welcom. Een goede reparatie is altijd nog voordeliger dan een nieuw toestel. Wij helpen u daarom graag verder; snel en voordelig. Ook als u uw telefoon niet bij ons gekocht heeft. Wij hebben de onderdelen van de meest voorkomende reparaties standaard op voorraad en kunnen we u in veel gevallen direct helpen. En duurt het toch wat langer? Dan helpen wij u graag verder met een leentoestel om de tijd te overbruggen. Bij het ophalen laten wij u zien hoe de reparatie is en welke garanties hierop van toepassing zijn. En wilt u de kans op schade in de toekomst beperken? Kies dan gelijk even een goed hoesje of screenprotector voor extra bescherming. Voorkomen is immers altijd voordeliger dan repareren.&nbsp;</div>\"}','{\"nl\": \"de-bosselaar-1\"}',52.19586590,6.00491740,'De eglantier','119',NULL,'7329 DC','Apeldoorn','Netherlands','NL',1,0,NULL,'2021-04-09 15:52:57','2021-07-19 08:18:53',NULL),
	(517,'fee04715-42bb-42b0-aa7f-969f1590c35e',517,'{\"nl\": \"De Bosselaar copy (19/07/2021)\"}','{\"nl\": \"<div>Defect aan uw telefoon of tablet? Ook dan komt u naar Welcom. Een goede reparatie is altijd nog voordeliger dan een nieuw toestel. Wij helpen u daarom graag verder; snel en voordelig. Ook als u uw telefoon niet bij ons gekocht heeft. Wij hebben de onderdelen van de meest voorkomende reparaties standaard op voorraad en kunnen we u in veel gevallen direct helpen. En duurt het toch wat langer? Dan helpen wij u graag verder met een leentoestel om de tijd te overbruggen. Bij het ophalen laten wij u zien hoe de reparatie is en welke garanties hierop van toepassing zijn. En wilt u de kans op schade in de toekomst beperken? Kies dan gelijk even een goed hoesje of screenprotector voor extra bescherming. Voorkomen is immers altijd voordeliger dan repareren.&nbsp;</div>\"}','{\"nl\": \"de-bosselaar\"}',52.19586590,6.00491740,'De eglantier','119',NULL,'7329 DC','Apeldoorn','Netherlands','NL',1,1,516,'2021-04-09 15:52:57','2021-07-19 08:18:53','2021-07-19 08:18:53');
