	(2,'4dd08150-b4cc-494c-bac1-04a4ee9f9b8c','{\"nl\": \"Aitec\"}','{\"nl\": \"AITEC is een technische vakhandel voor electronica in Leuven en Oost-Vlaams-Brabant. Onze firma start waar de Hifi, TV of computerzaak eindigt. Bij ons worden die zaken aangeboden die niet of moeilijk in de klassieke handel verkrijgbaar zijn. U kan bij ons terecht voor alle soorten batterijen, audio, video of computerkabels, enz.. Ons gamma en onze stock zijn zeer uitgebreid. Hebt u een elektronica probleem en weet u niet waar u daarvoor terecht kan, probeer ons eens. Veel kans dat we u kunnen helpen.\"}','{\"nl\": \"aitec\"}','{\"nl\": null}',0,'{\"en\": null}',1,0,0,1,1,'City of Leuven','2021-04-09 15:52:49','2021-05-05 13:59:48',NULL),
