	(8,'fc30b890-0b63-4417-9806-35aa1fd07392','{\"nl\": \"atelier VAN EYCK\"}','{\"nl\": \"Welkom! Al meer dan 110 jaar vindt u bij familiebedrijf Atelier Van Eyck degelijke kwaliteit en service.\\nOnze roots liggen in de ijzerwaren. We zijn een zaak die blijft evolueren, volledig mee met de tijd en gericht naar de toekomst.\\nEsthetiek en kwaliteit blijven we verbinden. \\n... Het doet vermoeden dat kunstschilder Jan Van Eyck in ons DNA terug te vinden is ...\"}','{\"nl\": \"atelier-van-eyck\"}','{\"nl\": null}',0,'{\"en\": null}',1,0,0,1,1,'City of Leuven','2021-04-09 15:52:49','2021-05-05 13:59:51',NULL),
	(9,'b05e184b-fe33-4728-891c-e452760f4ea9','{\"nl\": \"Repair Café Wijgmaal\"}','{\"nl\": \"Maakbaar Leuven is een netwerkorganisatie die een lans wil breken voor de hersteleconomie. De vzw bundelt kennis, kunde en infrastructuur voor hersteloplossingen in de Leuvense regio.\\nMet de hulp van geëngageerde burgers (van 15 tot 105) verkleinen we de afvalberg. Zo hebben we, samen met onze partners, een repair-beweging opgebouwd met heel wat expertise.\"}','{\"nl\": \"repair-cafe-wijgmaal\"}','{\"nl\": null}',0,'{\"en\": null}',1,0,0,1,2,'City of Leuven','2021-04-09 15:52:49','2021-05-05 13:59:51',NULL),
	(10,'70d77a3f-6ab5-4a01-bf8b-15067cd870a9','{\"nl\": \"King Mobile\"}','{\"nl\": \"Snel, Betaalbare Tablet, Laptop, Game Console en Smartphone Reparaties.\\nUw gadgets spelen een belangrijke rol in uw professionele, persoonlijke en schoolse leven. Wanneer uw telefoon, tablet of laptop kapot gaat, wilt u dat een expert de reparatie afhandelt. Met meer dan 10 jaar ervaring kan Mobile King de klus snel en effectief klaren. \"}','{\"nl\": \"king-mobile\"}','{\"nl\": null}',0,'{\"en\": null}',1,0,0,1,1,'City of Leuven','2021-04-09 15:52:49','2021-05-05 13:59:52',NULL),
