	(13,'e3cc1f44-eaea-4d24-b118-fef42a6382dd','{\"nl\": \"Elektro Buisset\"}','{\"nl\": \"U vindt op onze website alle merken en produkten die wij verkopen.Vanzelfsprekend zijn niet alle produkten in voorraad, maar we kunnen u steeds binnen de kortste termijn leveren.\\nElektro Buisset is één van de zeldzame elektrozaken, die niet gebonden is aan één of andere keten, waardoor we zelf kunnen beslissen welke merken en artikelen we wel of niet wensen te verkopen, dit op basis van onze jarenlange ervaring. Kwaliteit en betrouwbaarheid is onze leuze.\"}','{\"nl\": \"elektro-buisset\"}','{\"nl\": null}',0,'{\"en\": null}',1,0,0,1,1,'City of Leuven','2021-04-09 15:52:49','2021-05-05 13:59:53',NULL),
	(14,'5073db66-9567-42ac-a140-4e450f273cbe','{\"nl\": \"Repair Café Hal 5\"}','{\"nl\": \"<div>Maakbaar Leuven is een netwerkorganisatie die een lans wil breken voor de hersteleconomie. De vzw bundelt kennis, kunde en infrastructuur voor hersteloplossingen in de Leuvense regio. Met de hulp van geëngageerde burgers (van 15 tot 105) verkleinen we de afvalberg. Zo hebben we, samen met onze partners, een repair-beweging opgebouwd met heel wat expertise.</div>\"}','{\"nl\": \"repair-cafe-hal-5\"}','{\"nl\": null}',0,'{\"nl\": null}',1,0,0,1,2,'City of Leuven','2021-04-09 15:52:49','2021-05-11 15:07:22',NULL),
