	(22,'c549fb94-35b5-47a9-9095-14d279d05576','{\"nl\": \"Maakbar\"}','{\"nl\": \"MAAKbar is een ontmoetingsplek in Leuven waar handige Harry’s en Henriettes hun kapotte spullen kunnen herstellen. Of materiaal kunnen uitlenen in de gereedschapsbibliotheek. Er is ook een plantenasiel, een wenskaartenasiel en een vijzenbib. We doen regelmatig repair cafés en organiseren een uitgebreid aanbod aan zero waste workshops. Ben je zelf niet zo handig? Dan kan je er interessante workshops volgen om van iets ouds iets nieuws te maken. Want hoe meer je kan hergebruiken, hoe minder afval!\"}','{\"nl\": \"maakbar\"}','{\"nl\": null}',0,'{\"en\": null}',1,0,0,1,3,'City of Leuven','2021-04-09 15:52:49','2021-05-05 14:00:03',NULL),
