	(24,'7d637f4b-c690-471b-a506-a3c66f3de4ef','{\"nl\": \"CAT-Telecom\"}','{\"nl\": \"Hier kan je terecht voor een ruim aanbod aan multimedia- en elektronicaproducten.\\nWij bieden daarnaast ook energiediensten en telecomdiensten aan.\"}','{\"nl\": \"cat-telecom\"}','{\"nl\": null}',1,'{\"nl\": \"Ja, geen verdere info\"}',1,0,0,1,1,'City of Leuven','2021-04-09 15:52:49','2021-05-05 14:00:04',NULL),
	(25,'765b6edf-b2df-421d-ab9e-0781f334e341','{\"nl\": \"ALO iPhone repair Leuven\"}','{\"nl\": \"ALO repareert al sinds 2012 iPhones en iPads voor studenten, consumenten en bedrijven. De klanten zijn uiterst tevreden over de professionaliteit en service, maar vooral over de korte reparatietijd en uiterst flexibele afspraakuren. \"}','{\"nl\": \"alo-iphone-repair-leuven\"}','{\"nl\": null}',1,'{\"nl\": \"6 maanden garantie\"}',1,0,0,1,1,'City of Leuven','2021-04-09 15:52:49','2021-05-05 14:00:04',NULL),
	(26,'65a587ec-53c5-4bdd-bf89-0727e9232a7f','{\"nl\": \"Wifix Repair\"}','{\"nl\": \"Wifix is een jonge onderneming die allerlei reparaties uitvoert aan Smartphones en tablets. Door een snelle en persoonlijke aanpak kunnen wij tegen een scherpe prijs bijna alle herstellingen aan uw kapotte toestel in enkele dagen tijd repareren.\"}','{\"nl\": \"wifix-repair\"}','{\"nl\": null}',1,'{\"nl\": \"6 maanden op batterijen, 12 maanden op alle andere onderdelen\"}',1,0,0,1,1,'City of Leuven','2021-04-09 15:52:49','2021-05-05 14:00:05',NULL),
	(27,'1ee0a92e-c563-4a40-bdec-74234ccbaf00','{\"nl\": \"Herstel-PC\"}','{\"nl\": \"Wij zijn gespecialiseerd in het uitvoeren van herstellingen en onderhoud van uw computers en randapparatuur. Bij u thuis, in uw zaak, of gewoon bij ons\"}','{\"nl\": \"herstel-pc\"}','{\"nl\": null}',0,'{\"en\": null}',1,0,0,1,1,'City of Leuven','2021-04-09 15:52:49','2021-05-05 14:00:05',NULL),
	(28,'bb4201d8-5fe6-4ad8-868c-5399d94ba3ef','{\"nl\": \"Primaphone Leuven\"}','{\"nl\": \"Primaphone is gespecialiseerd in het repareren van smartphones, tablets en computers, aaronder iPhone, iPad en Samsung en we zijn trots op onze wachttijden, 12 maanden garantie en het garanderen van de veiligheid van uw privégegevens.\"}','{\"nl\": \"primaphone-leuven\"}','{\"nl\": null}',1,'{\"nl\": \"12 maanden garantie\"}',1,0,0,1,1,'City of Leuven','2021-04-09 15:52:49','2021-05-05 14:00:06',NULL),
	(29,'a25efee7-db8f-4922-b501-4280cc8c8ee7','{\"nl\": \"Switch\"}','{\"nl\": \"Switch is gecertificeerd door Apple als Apple Premium Reseller én als Authorised Service Provider. Bovendien zijn onze technici stuk voor stuk Apple Certified Engineers. Om maar te zeggen dat je met een gerust hart je toestel bij ons kan achterlaten en mag rekenen op een perfecte herstelling, zowel binnen als buiten de garantieperiode.\"}','{\"nl\": \"switch\"}','{\"nl\": null}',0,'{\"en\": null}',1,0,0,1,1,'City of Leuven','2021-04-09 15:52:49','2021-05-05 14:00:06',NULL),
	(30,'61c16f65-d759-4985-892b-42e2b0cfd630','{\"nl\": \"Herstelcenter.be\"}','{\"nl\": \"Herstelcenter.be is een professionele hersteller van niet enkel uw iPhone of iPad, smartphone of tablet, maar ook voor andere elektronica zoals laptop’s , gameconsoles, batterij packs voor powertools , … en dit voor verschillende merken\"}','{\"nl\": \"herstelcenterbe\"}','{\"nl\": null}',1,'{\"nl\": \"12 maanden garantie\"}',1,0,0,1,1,'City of Leuven','2021-04-09 15:52:49','2021-05-05 14:00:07',NULL),
	(31,'370274d3-ba94-468e-b2dc-15f93a560bc0','{\"nl\": \"Vanden Borre Leuven\"}','{\"nl\": \"Vanden Borre is een toonaangevend bedrijf op de Belgische markt in de verkoop van audio, tv\'s, multimedia en huishoudelektro. We maken deel uit van de groep Fnac Darty, een van de grootste distributeurs van huishoudelektro, culturele en technische producten in Europa, met een omzet van 7,4 miljard euro en die 26 000 mensen tewerkstelt.\"}','{\"nl\": \"vanden-borre-leuven\"}','{\"nl\": null}',0,'{\"en\": null}',1,0,0,1,1,'City of Leuven','2021-04-09 15:52:49','2021-05-05 14:00:07',NULL),
	(32,'c900e776-2f68-4833-a090-5c481aa2e31f','{\"nl\": \"Repairhub\"}','{\"nl\": \"De repairhub bevindt zich in maakleerplek, gelegen aan de Vaart. maakleerplek is een ruimte waar maken en leren centraal staan en verschillende organisaties samen aan deze visie werken. Eén van de deelplekken \'het low-techlab\' focust op maken en herstellen, hierbij sluit de repairhub aan. In de repairhub staat herstellen centraal. Er is gereedschap om te herstellen en er worden regelmatig herstelavonden/evenementen georganiseerd. Daarnaast wordt er in de repairhub geëxperimenteerd met wisselstukken en zal er in de toekomst een uitgebreid aanbod aan wisselstukken beschikbaar zijn.\"}','{\"nl\": \"repairhub\"}','{\"nl\": null}',0,'{\"en\": null}',1,0,0,1,NULL,'City of Leuven','2021-04-09 15:52:49','2021-05-05 14:00:08',NULL),
	(33,'9d63188c-e603-4ede-9747-22f137c6445b','{\"nl\": \"Student Repair Hub\"}','{\"nl\": \"Een plaats waar studenten terecht kunnen om apparaten samen te herstellen. Daarnaast is er ook een gereedschapbibliotheek waar studenten gratis gereedschap kunnen uitlenen.\"}','{\"nl\": \"student-repair-hub\"}','{\"nl\": null}',0,'{\"en\": null}',1,0,0,1,3,'City of Leuven','2021-04-09 15:52:49','2021-05-05 14:00:08',NULL),
