	(483,'608e1bc4-13de-4311-817a-6c0be78b34ad','{\"nl\": \"AB tuinmachines onderhoud & reperaties \"}','{\"nl\": \"Is uw tuinmachine defect? Maak een afspraak voor reparatie. U kunt de machine bij ons brengen (op afspraak), u kunt gebruik maken van de \\\"Haal- en Brengservice\\\" of wij repareren bij u aan huis.\"}','{\"nl\": \"ab-tuinmachines-onderhoud-reperaties\"}','{\"nl\": \"garden machinery \"}',0,'{\"en\": null}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:03:50',NULL),
	(484,'3897baad-d93d-4901-868a-26e0e8a17b50','{\"nl\": \"A&B Reparatie Service\"}','{\"nl\": \"A&B Reparatie service Apeldoorn repareert witgoed apparaten. Bent u op zoek naar een Witgoed reparatie service voor uw wasmachine, droger, vaatwasser, magnetron inductie, gas of keramische kookplaat? Onze monteur komt bij u langs en u kunt tijdens de reparatie over zijn schouder meekijken, zodat alles transparant voor u is. Is er toch meer stuk, dan wordt er met u als klant overlegt of u dit dan wilt laten repareren of niet.\"}','{\"nl\": \"ab-reparatie-service\"}','{\"nl\": \"dryer, washing machine, dishwasher, fridge\"}',1,'{\"nl\": \"De reparateur geeft na een voltooide reparatie een garantie van drie maanden op arbeid/voorrijden en 6 maanden op onderdelen. Deze garantie gaat in na betaling van de uitgevoerde reparatie.\"}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:03:51',NULL),
	(485,'bd47e186-dcf9-4ff6-931d-0da95e9b6018','{\"nl\": \"Alfabyte\"}','{\"nl\": \"Op zoek naar een betaalbare en preventieve oplossing voor uw computer- of laptop problemen of wensen, zoals een upgrade van uw huidige computer? Dan bent u bij ons aan het juiste adres. Wij hebben een eigen technische dienst maar komen ook bij u op locatie!\"}','{\"nl\": \"alfabyte\"}','{\"nl\": \"desktop, laptops, keyboards, screens\"}',0,'{\"en\": null}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:03:51',NULL),
	(486,'969be928-9657-4c50-b6a0-04482fddb37e','{\"nl\": \"All-in Witgoedservice \"}','{\"nl\": \"All in Witgoedservice is dé witgoedspecialist van regio Apeldoorn. Naast het inbouwen van onder andere vaatwassers, magnetrons en ovens leveren wij ook onderdelen en repareren aan huis. Eerlijkheid en betrouwbaarheid staan bij ons voorop en wij werken snel voor een goede prijs. Al onze prijzen zijn zoals onze naam al doet vermoeden All Inclusive! Voor spoedgevallen is All in Witgoedservice 24 uur per dag, 7 dagen per week telefonisch te bereiken.\"}','{\"nl\": \"all-in-witgoedservice\"}','{\"nl\": \"Dryers, washingmachines, dishwashers, refrigirators, stoves, extractor hood, ovens, microwaves \"}',1,'{\"nl\": \"All in witgoed geeft na een voltooide reparatie een garantie van drie maanden op het geldende, van te voren vastgelegde All in Tarief  en 3 maanden garantie op verbruikte  onderdelen. Deze garantie gaat in na het uitvoeren van de reparatie, gekoppeld aan de  reparatie datum vermeldt op de afgegeven factuur het geen los staat van een direct voldane factuur of uitgestelde betaling. Op schoonmaak – c.q. onderhoudsbeurten alsmede op reparaties, verricht aan apparaten met bliksem -, water-, of vochtschade wordt geen garantie gegeven, tenzij op de factuur nadrukkelijk wordt vermeld.\"}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:03:52',NULL),
	(487,'16995cfb-0fea-4f2f-81a5-e00d4c8bd4e4','{\"nl\": \"Computer Support Apeldoorn\"}','{\"nl\": \"Is uw computer vastgelopen, heeft u virusproblemen, werkt uw (draadloos)netwerk niet? Of wilt u advies bij aanschaf van computer- en multimedia-apparatuur.\\nWij komen langs, wanneer het U uitkomt!\"}','{\"nl\": \"computer-support-apeldoorn\"}','{\"nl\": \"computers, multimedia equipement \"}',0,'{\"en\": null}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:03:52',NULL),
	(488,'8ef683df-b056-4c81-bd98-9c9e64fb4731','{\"nl\": \"Edutech Bouwmachine Service\"}','{\"nl\": \"Edutech Bouwmachine Service bestaat intussen al meer dan 15 jaar. In al die jaren uitgegroeid tot een allround serviceverlenend bedrijf dat onderhoud en reparaties uitvoert aan diverse bouwmachines zoals shovels, graafmachines en trilplaten.\"}','{\"nl\": \"edutech-bouwmachine-service\"}','{\"nl\": \"Construction machinerey \"}',0,'{\"en\": null}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:03:53',NULL),
	(489,'98a1c9ba-81de-4a7f-a7b0-d87731039105','{\"nl\": \"JDA witgoed \"}','{\"nl\": \"JDA Witgoed: dé witgoedspecialist van Apeldoorn en omstreken!\\nHet gezicht van JDA Witgoed is John Dalhuisen, een zeer ervaren witgoed en elektrotechnisch monteur.\\nIn zijn jarenlange carrière is hij alles wel een keer tegen gekomen. Deze ervaring zet hij in om uw apparaat snel en doeltreffend te repareren. Mocht uw apparaat de reparatie niet waard zijn zal hij daar duidelijk over communiceren en diverse andere opties bieden.\"}','{\"nl\": \"jda-witgoed\"}','{\"nl\": \"Dryers,washingmachines, dishwashers, refrigirators \"}',0,'{\"en\": null}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:03:53',NULL),
	(490,'78cfdbfa-b8f3-488c-a80c-eff9e2652b6b','{\"nl\": \"Hitronics \"}','{\"nl\": \"Hitronics heeft haar pijlen voornamelijk gericht op het leveren van goederen en diensten aan particulieren en bedrijven.\\n\\nWij leveren de volgende ICT diensten:\\n\\nVerkoop van (nieuwbouw) desktop computers\\nComputer reparatie\\nBeheer van uw infrastructuur\\nDraadloze netwerk oplossingen\\nSynology Backup oplossingen\\nWebServices\\nServer Management\\nsuper snelle service!\\nen nog veel meer!\"}','{\"nl\": \"hitronics\"}','{\"nl\": \"Computer repair \"}',0,'{\"en\": null}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-04-09 15:52:57',NULL),
	(491,'ae87a3b4-5669-404c-9a84-24780353df3c','{\"nl\": \"ICanFix\"}','{\"nl\": \"iCanFix repareert werkelijk alles op electronica gebied, maar ook voor bijvoorbeeld garantie afhandeling kunt u bij ons terecht.\\n\\nWij behandelen oprecht alle mogelijke reparaties, daardoor heeft u maar 1 partner nodig, iCanFix\"}','{\"nl\": \"icanfix\"}','{\"nl\": \"Telecom repair, computer repair, tablet repair, camera repair, motherboard repair, navigation repair\"}',0,'{\"en\": null}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:03:54',NULL),
	(492,'27e5755f-5920-4774-9076-f35223ff9d1d','{\"nl\": \"ICTBelang\"}','{\"nl\": \"Particulieren - 24 uur reparatie\"}','{\"nl\": \"ictbelang\"}','{\"nl\": \"Computer repair \"}',0,'{\"en\": null}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:03:55',NULL),
	(493,'8d00cff5-477e-4da7-a765-7e85c3e04385','{\"nl\": \"Repair phone Apeldoorn\"}','{\"nl\": \"Repair Phone Apeldoorn is een bedrijf dat gespecialiseerd is in het verkopen van mobiele telefoon accessoires en het repareren van mobiele telefoons. Naast reparatie en accessoires, biedt Repair Phone Apeldoorn simlockvrije mobiele telefoons aan, tegen zeer scherp prijs, zowel nieuw als tweedehands.\\n\\nMet meer dan 11 jaar werkervaring, kunnen wij elke klant de beste service garanderen die de stad te bieden heeft. wij kunnen u ten allen tijden service verlenen voor zowel nieuwe telefoon modellen als voor oudere modellen!\"}','{\"nl\": \"repair-phone-apeldoorn\"}','{\"nl\": \"Telecom repair, computer repair\"}',0,'{\"en\": null}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:03:55',NULL),
	(494,'5f11f76e-26f6-4858-8879-58513538d43f','{\"nl\": \"fix-phone apeldoorn\"}','{\"nl\": \"Kapotte GSM of tablet? Wij repareren hem!\"}','{\"nl\": \"fix-phone-apeldoorn\"}','{\"nl\": \"Telecom (mobile phones), tablets \"}',1,'{\"nl\": \"Bij ons krijg u 6 maanden garantie op uw reparatie\"}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:03:56',NULL),
	(495,'69d8b0f1-ead9-4ac9-954c-1d5258a68fd2','{\"nl\": \"SmartFix Apeldoorn\"}','{\"nl\": \"Smart fix \"}','{\"nl\": \"smartfix-apeldoorn\"}','{\"nl\": \"Mobile repair \"}',1,'{\"nl\": \"De ondernemer staat er voor in dat de producten en/of diensten voldoen aan de overeenkomst, de in het aanbod vermelde specificaties, aan de redelijke eisen van deugdelijkheid en/of bruikbaarheid en de op de datum van de totstandkoming van de overeenkomst bestaande wettelijke bepalingen en/of overheidsvoorschriften. Indien overeengekomen staat de ondernemer er tevens voor in dat het product geschikt is voor ander dan normaal gebruik.\"}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:03:56',NULL),
	(496,'a28a7e3e-ddb5-450e-9838-427fea265c9d','{\"nl\": \"Krygsman IT \"}','{\"nl\": \"Welkom bij Krygsman IT. Bij ons gaat het om tevredenheid en persoonlijke service. Daarom rekenen wij geen onderzoekskosten dus GEEN HERSTEL = GEEN KOSTEN. W\"}','{\"nl\": \"krygsman-it\"}','{\"nl\": \"Computer repair \"}',1,'{\"nl\": \"Bij al ons uitgevoerde reparatie krijgt u drie maanden garantie op het vervangende onderdeel. Uitgezonderd val/stoot/vocht, waterschade en gebruikers fout.\"}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:03:57',NULL),
	(497,'7c7db672-3ed1-4f0a-869d-a653652d9c2e','{\"nl\": \"MobileNed\"}','{\"nl\": \"MobileNed reparateurs hebben de juiste kennis in huis voor reparaties aan iPhone en iPad. Doordat wij enkel Apple producten repareren hebben wij hier veel ervaring mee en bieden wij een professioneel uitgevoerde reparatie. \\n\\nDaarnaast maken wij alleen gebruik van kwaliteitsonderdelen. \\n\\nHierdoor geven wij ook 1 jaar garantie op de reparatie (m.u.v. batterijen). \"}','{\"nl\": \"mobilened\"}','{\"nl\": \"Mobile phones (Iphone)\"}',1,'{\"nl\": \"12 maanden garantie \"}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:03:57',NULL),
	(498,'50f0f6ee-b739-47db-87cf-9ec5724ee5c0','{\"nl\": \"ACTG \"}','{\"nl\": \"Niets vervelender dan een storing of defect. Reparatie is dan gewenst en het liefst op korte termijn. Een lang traject met vele stadia kan dan ook nog eens frustrerend werken. Wat u zoekt is een duidelijk en helder antwoord. Bij ACTG bekijken en bepraten we de reparatie/storing met u persoonlijk. Op deze wijze zijn er ook goede afspraken te maken over kosten en reparatietermijnen. Afhankelijk van de aard van de reparatie of storing is het mogelijk om naar een tijdelijk/vervangend apparaat te kijken. Op deze wijze kun u gewoon verder totdat de hoofdstoring is verholpen of reparatie uitgevoerd.\\n\\n \\n\\nWij repareren praktisch alles op het gebied van elektronica. Vooraf doen wij een onderzoek naar het defect en krijgt u van ons een prijsopgave. Bij de ontvangst van de prijsopgave kunt u altijd nog beslissen of u de reparatie doorgang wil laten vinden of niet. Natuurlijk adviseren wij u ook of het raadzaam is om de reparatie te laten uitvoeren. Soms kan het apparaat of onderdeel laten vervangen voordeliger zijn dan repareren. Ook op dit gebied krijgt u weloverwogen advies. Aan het onderzoek zijn geen kosten verbonden.\"}','{\"nl\": \"actg\"}','{\"nl\": \"Computer/phones\"}',0,'{\"en\": null}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:03:58',NULL),
	(499,'015afae4-7881-4ea0-837e-2f901bfdf3d6','{\"nl\": \"PC Coach \"}','{\"nl\": \"Diagnose en reparatie\"}','{\"nl\": \"pc-coach\"}','{\"nl\": \"Computers\"}',0,'{\"en\": null}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:03:58',NULL),
	(500,'a5d87f92-04eb-4b99-aaff-3e9fbb6ce450','{\"nl\": \"Ray\'s guitar Repair house\"}','{\"nl\": \"Bij Ray\'s Guitar kun je jouw gitaar of bass, professioneel laten afstellen, repareren, onderhouden, refretten, vlakken en cröwnen of te laten modificeren.\"}','{\"nl\": \"rays-guitar-repair-house\"}','{\"nl\": \"Electric guitars \"}',0,'{\"en\": null}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:03:59',NULL),
	(501,'a99aac35-5028-4379-8783-b44eb86e7e59','{\"nl\": \"Technorette\"}','{\"nl\": \"Technorette repareert alle merken elektrische huishoudelijke apparaten voor particulieren, maar ook voor bedrijven en instellingen. Wij repareren op locatie en wanneer nodig in onze moderne werkplaats. Door onze uitgebreide onderdelenvoorraad zijn wij in bijna alle gevallen in staat uw apparaat direct te repareren. \"}','{\"nl\": \"technorette\"}','{\"nl\": \"Washingmachines, dryers, dishwashers\"}',1,'{\"nl\": \"garantie van 6 maanden \"}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:03:59',NULL),
