	(503,'46d46cca-ad35-4b5d-b77f-7e1441e0187b','{\"nl\": \"Foenix Repaircafe \"}','{\"nl\": \"Kapot is het nieuwe nieuw! Bij het permanente Repair Café kun je terecht voor reparatie aan kleingoed met een stekker. Samen met jou wordt gekeken of het defect is op te lossen.\"}','{\"nl\": \"foenix-repaircafe\"}','{\"nl\": \"Wide range of products\"}',0,'{\"en\": null}',1,0,0,1,NULL,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:04:00',NULL),
