	(505,'910bc385-41f0-4caf-8088-fff164b9d15d','{\"nl\": \"Kringloopwinkel de Hofstad\"}','{\"nl\": \"ONZE MISSIE\\n1) HET WEGGOOIEN VAN GOEDE  GOEDEREN VOORKOMEN\\n2) MENSEN MET EEN KLEINE BEURS HELPEN GOEDKOOP TE KUNNEN KOPEN\\n3) GOEDE DOELEN FINANCIEEL STEUNEN\"}','{\"nl\": \"kringloopwinkel-de-hofstad\"}','{\"nl\": \"Wide range of products\"}',0,'{\"en\": null}',1,0,0,1,6,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:04:01',NULL),
	(506,'b13c6ebe-639b-4091-b044-f631e5fa565c','{\"nl\": \"Foenix Kringloop\"}','{\"nl\": \"Waarom hergebruiken met Foenix? Het is goed voor het milieu en het klimaat. Je ondersteunt mensen bij hun re-integratie. Jouw herbruikbare spullen zijn pareltjes voor een ander.\"}','{\"nl\": \"foenix-kringloop\"}','{\"nl\": \"Wide range of products\"}',0,'{\"en\": null}',1,0,0,1,6,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:04:02',NULL),
	(507,'181fca21-6abb-49af-bf20-940fcfac893f','{\"nl\": \"Foenix Kringloop\"}','{\"nl\": \"Waarom hergebruiken met Foenix? Het is goed voor het milieu en het klimaat. Je ondersteunt mensen bij hun re-integratie. Jouw herbruikbare spullen zijn pareltjes voor een ander.\"}','{\"nl\": \"foenix-kringloop-1\"}','{\"nl\": \"Wide range of products\"}',0,'{\"en\": null}',1,0,0,1,6,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:04:02',NULL),
	(508,'f79b1c61-fc49-4dcc-948e-ad08add12305','{\"nl\": \"Daan\'s Hulp\"}','{\"nl\": \"Mijn computerwinkel is gevestigd in Apeldoorn. Hier voer ik reparaties uit, help ik klanten en verkoop ik computer en telefoon onderdelen. Komt u gerust eens langs voor een kopje koffie of thee.\"}','{\"nl\": \"daans-hulp\"}','{\"nl\": \"Computers, mobile phones, tablets\"}',0,'{\"en\": null}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:04:03',NULL),
	(509,'a1023a81-1c29-4141-883a-2a559e842ef1','{\"nl\": \"Stad Phone \"}','{\"nl\": \"StadPhone staat bekend als de Gsm-specialist van Apeldoorn. We bieden onze service en producten al meer dan 14 jaar in Apeldoorn. Door onze ervaring kunnen we u op alle gebieden van telefonie, tablets en computers helpen. Al u problemen ondervindt met of vragen heeft kunt u altijd bij ons langs komen en wij zoeken graag samen met u de oplossing. Voor reparatie bent u bij ons aan het juiste adres. Iedere werkdag kunt u zonder afspraak uw toestel bij ons langs komen brengen. Uw toestel zal ter plekke in onze “repair centre” gerepareerd worden. Voor smartphone en tablet accessoires hebben wij de grootste keus in Apeldoorn sinds 2001\"}','{\"nl\": \"stad-phone\"}','{\"nl\": \"Mobile phones, tablets, computers\"}',0,'{\"en\": null}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:04:03',NULL),
	(510,'94bd9612-71f1-4dbc-8f84-6cae3980d3b0','{\"nl\": \"Repair plus\"}','{\"nl\": \"Welkom allemaal. Repair Plus is een telefoonwinkel gevestigd in Apeldoorn, Stationsstraat 145B. Voor de beste service en kwaliteit kunt u bij ons terecht.\\n\\nGelukkig kunnen wij je reparatie vaak erg snel uitvoeren. Een van onze reparatie specialisten behandelt de reparatie direct en zal je toestel vakkundig repareren. Je  reparatie wordt altijd vakkundig uitgevoerd en op elke reparatie zit standaard 6 maanden garantie zodat je bent verzekerd van een goed werkende toastel.\"}','{\"nl\": \"repair-plus\"}','{\"nl\": \"Mobile phones, tablets, computers\"}',1,'{\"nl\": \"tot 12 maanden garantie \"}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:04:04',NULL),
	(511,'3c404993-0a28-4b17-b196-c377422917d5','{\"nl\": \"RTV Stegeman\"}','{\"nl\": \"Een defect of storing aan een apparaat is heel erg vervelend. Dat snappen we. In onze winkel stellen we de hoogste eisen en leveren uitsluitend hoge kwaliteit. Toch kan het voorkomen dat apparatuur niet naar behoren werkt. Geen zorgen, we gaan direct voor u aan de slag met de reparatie.\"}','{\"nl\": \"rtv-stegeman\"}','{\"nl\": \"Wide range of products \"}',1,'{\"nl\": \"3 years \"}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:04:04',NULL),
	(512,'a60b6ed5-811c-498b-9983-19b70c285214','{\"nl\": \"Het onderdelenhuis Plentyparts\"}','{\"nl\": \"Al 30 jaar het meest complete onderdelenhuis van Apeldoorn en omstreken! In 1987 zijn wij als “Het Onderdelenhuis” gevestigd aan de Asselsestraat in Apeldoorn (sinds 1996 Plentyparts). Veel klanten in en rondom Apeldoorn hebben ons weten te vinden als hét adres voor onderdelen en accessoires voor: huishoudelijke apparaten, elektra, sanitair, fiets, auto, computer, printer, smartphones en tablets. Daarnaast hebben wij een groot assortiment onderhouds- en reinigingsproducten voor alles in en om je huis.Onze specialisten hebben jarenlange ervaring en zijn bijna opgegroeid in onze winkel. Wij vinden het belangrijk om onze klanten nét die extra service te geven die je in andere winkels of online niet tegenkomt. We denken graag in oplossingen. Plentyparts Apeldoorn is gewoon hét onderdelenhuis\"}','{\"nl\": \"het-onderdelenhuis-plentyparts\"}','{\"nl\": \"Wide range of products \"}',0,'{\"en\": null}',1,0,0,1,5,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:04:05',NULL),
	(513,'2e04f994-bb72-4ecc-a6ef-c4aaa85dbe41','{\"nl\": \"Repair Café Talma Borgh Apeldoorn\"}','{\"nl\": \"reparatiekennis van beeld en geluidsapparatuur, computerapparatuur/ telefoons, fietsen, gereedschap elektrisch, huishoudelijke apparaten, niet huishoudelijke apparaten, meubels, elektrisch speelgoed, \"}','{\"nl\": \"repair-cafe-talma-borgh-apeldoorn\"}','{\"nl\": \"wide range of products\"}',0,'{\"en\": null}',1,0,0,1,2,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:04:05',NULL),
	(514,'32636c93-1995-4166-a259-92438a39ff8f','{\"nl\": \"PartsNL\"}','{\"nl\": \"Heb je een vraag over je apparaat of wil je advies over het onderhoud of het vervangen van een onderdeel? Kijk in ons adviescentrum\"}','{\"nl\": \"partsnl\"}','{\"nl\": \"Wide range of products\"}',1,'{\"nl\": \"artikel 12\"}',1,0,0,1,5,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:04:06',NULL),
	(515,'5353fc99-0e3a-4967-b238-8980749cc484','{\"nl\": \"Hamer Electro World \"}','{\"nl\": \"Ook voor reparaties van uw apparatuur bent u bij ons op het goede adres, deze worden vakkundig uitgevoerd door onze eigen technische dienst. Wij streven er dan ook naar om u zo goed mogelijk van dienst te kunnen zijn.\"}','{\"nl\": \"hamer-electro-world\"}','{\"nl\": null}',0,'{\"en\": null}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-05-05 14:04:06',NULL),
	(516,'8ff61cb4-443a-4efb-9549-136440494dw','{\"nl\": \"De Bosselaar\"}','{\"nl\": \"<div>Defect aan uw telefoon of tablet? Ook dan komt u naar Welcom. Een goede reparatie is altijd nog voordeliger dan een nieuw toestel. Wij helpen u daarom graag verder; snel en voordelig. Ook als u uw telefoon niet bij ons gekocht heeft. Wij hebben de onderdelen van de meest voorkomende reparaties standaard op voorraad en kunnen we u in veel gevallen direct helpen. En duurt het toch wat langer? Dan helpen wij u graag verder met een leentoestel om de tijd te overbruggen. Bij het ophalen laten wij u zien hoe de reparatie is en welke garanties hierop van toepassing zijn. En wilt u de kans op schade in de toekomst beperken? Kies dan gelijk even een goed hoesje of screenprotector voor extra bescherming. Voorkomen is immers altijd voordeliger dan repareren.&nbsp;</div>\"}','{\"nl\": \"de-bosselaar-1\"}','{\"nl\": \"<div>Mobile phones (Iphone)</div>\"}',0,'{\"nl\": null}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-07-19 08:18:53',NULL),
	(517,'fee04715-42bb-42b0-aa7f-969f1590c35e','{\"nl\": \"De Bosselaar copy (19/07/2021)\"}','{\"nl\": \"<div>Defect aan uw telefoon of tablet? Ook dan komt u naar Welcom. Een goede reparatie is altijd nog voordeliger dan een nieuw toestel. Wij helpen u daarom graag verder; snel en voordelig. Ook als u uw telefoon niet bij ons gekocht heeft. Wij hebben de onderdelen van de meest voorkomende reparaties standaard op voorraad en kunnen we u in veel gevallen direct helpen. En duurt het toch wat langer? Dan helpen wij u graag verder met een leentoestel om de tijd te overbruggen. Bij het ophalen laten wij u zien hoe de reparatie is en welke garanties hierop van toepassing zijn. En wilt u de kans op schade in de toekomst beperken? Kies dan gelijk even een goed hoesje of screenprotector voor extra bescherming. Voorkomen is immers altijd voordeliger dan repareren.&nbsp;</div>\"}','{\"nl\": \"de-bosselaar\"}','{\"nl\": \"<div>Mobile phones (Iphone)</div>\"}',0,'{\"nl\": null}',1,0,0,1,1,'City of Apeldoorn','2021-04-09 15:52:57','2021-07-19 08:18:53','2021-07-19 08:18:53');
